import React from "react";
import { Link } from "react-router-dom";

function Header() {
  return (
    <div className="text-white fixed flex flex-row-reverse w-full">
      <div>
        <Link to="#skills">Skills</Link>
      </div>
    </div>
  );
}

export default Header;
